import logo from './logo.svg';
import './App.css';
import NavBar from './components/Navbar.js';
import Content from './components/Content.js';

function App() {
  const images = require.context('../public/character_images', true);
  const background = images('./parchment.jpg');

  return (
    <div className="App w-screen h-screen bg-cover bg-[#FCF5E5] text-center">
      <NavBar />
      <Content />
    </div>
  );
}

export default App;
